import React from "react";
import "./messenger.css"

export default function Messenger() {
    const messages = [
        {content:"Hi!", author: {username:"ivanov"}},
        {content:"Hello!", author: {username:"testuser"}},
        {content:"How to ...?", author: {username:"ivanov"}},
    ]

    return (
        <div>
            <li style={{marginLeft: 35}}>
                <div className="bg-light m-5 p-3 fpWrapper">
                    <ul className="messengerUl">
                        {messages.map(msg => {
                                return <li className="messengerLi">
                                            {msg.content}
                                        </li>
                            })
                        }
                    </ul>

                    <div className="input-group">
                        <input id="messageContent" type="text" className="form-control" aria-describedby="basic-addon2"/>
                        <button id="startBtn" type="button" className="btn btn-primary">Send</button>
                    </div>
                </div>
            </li>
        </div>
    )
}
